import React, { Component } from "react";

class Login extends Component {
  state = {
    Email: {},
    Password: {}
  };
  render() {
    return (
      <div>
        <div class="split left">
          <div class="centered">
            <h2>Jane Flex</h2>
            <p>Some text.</p>
          </div>
        </div>

        <div class="split right">
          <div class="centered">
            <form>
              <input type="text" />
            </form>
          </div>
        </div>
      </div>
    );
  }
}

export default Login;
